import logo from "../../../assets/i/logo.svg";
import { Box, Image } from "@chakra-ui/react";
import { Link } from "react-router-dom";

export const Logo = () => {
  return (
    <Box>
      <Link to={"/"}>
        <Image src={logo} alt={"Java-academy  Logo"} m={"53px 107px"} />
      </Link>
    </Box>
  );
};
